import React from "react";

export default function NavBar()
{
    let navStyle = {
        display: "flex",
    }
    return (
        <nav style = {navStyle}>
            <img className = "nav--logo"/>
            <div>
                <h3>Blogs</h3>
                <h3>Contacts</h3>
                <h3>About</h3>
            </div>

        </nav>
    )
}
